import React, { Component } from 'react';
import logo from '../contents/ArtWalk_Logo final_ww.png';
export default class Header extends Component {
  render() {
    return (
      <div className="row">
        <div className="logo">
          <img alt="" src={logo} width="270" height="50" />
        </div>
      </div>
    );
  }
} 



